use crate::Solution;

#[test]
// #[ignore]
fn case_1() {
    assert!(
        Solution::longest_palindrome_check_all(("babad").to_string()) == "bab"
            || Solution::longest_palindrome_check_all(("babad").to_string()) == "aba"
    );
    assert!(
        Solution::longest_palindrome_dynamic(("babad").to_string()) == "bab"
            || Solution::longest_palindrome_dynamic(("babad").to_string()) == "aba"
    );
    assert!(
        Solution::longest_palindrome_center_expand(("babad").to_string()) == "bab"
            || Solution::longest_palindrome_center_expand(("babad").to_string()) == "aba"
    );
    assert!(
        Solution::longest_palindrome_manachers(("babad").to_string()) == "bab"
            || Solution::longest_palindrome_manachers(("babad").to_string()) == "aba"
    );
}

#[test]
// #[ignore]
fn case_2() {
    assert_eq!(
        Solution::longest_palindrome_check_all(("cbbd").to_string()),
        "bb"
    );
    assert_eq!(
        Solution::longest_palindrome_dynamic(("cbbd").to_string()),
        "bb"
    );
    assert_eq!(
        Solution::longest_palindrome_center_expand(("cbbd").to_string()),
        "bb"
    );
    assert_eq!(
        Solution::longest_palindrome_manachers(("cbbd").to_string()),
        "bb"
    );
}

